import React from 'react';

const Home = () => {


    return(
        <div className="App">
        <h1>Welcome to your adventure land!</h1>
            <br></br>
            <br></br>
            <p>To continue on your adventure, create your own adventure buddy!</p>
            <img src = "https://res.cloudinary.com/mumtazf/image/upload/v1681189171/dora.png" alt ="dora the explorer"/>
        </div>
    )
}
export default Home;
